                    {/*<!-- USERNAME INPUT -->*/}
              <label for="Labores a desempeñar">Labores a desempeñar</label>
                    <select name="Labores">

                        <option>Paseador de Perros</option>

                        <option>Plomero</option>

                        <option>Gigolo</option>

                    </select>
                    {/*<!-- PASSWORD INPUT -->*/}
